/* global redux_change, reduxSpinners */jQuery(document).ready(function(){jQuery(".redux_spinner").each(function(){var e=reduxSpinners[jQuery(this).attr("rel")];jQuery("#"+e.id).spinner({value:parseInt(e.val,null),min:parseInt(e.min,null),max:parseInt(e.max,null),step:parseInt(e.step,null),range:"min",slide:function(t,n){var r=jQuery("#"+e.id);r.val(n.value);redux_change(r)}});var t=!1;parseInt(e.min,null)<0&&(t=!0);jQuery(".spinner-input").numeric({negative:t,min:e.min,max:e.max})});jQuery(".spinner-input").keyup(function(){jQuery(this).addClass("spinnerInputChange")});jQuery(".spinner-input").focus(function(){if(!jQuery(this).hasClass("spinnerInputChange"))return;jQuery(this).removeClass("spinnerInputChange");var e=reduxSpinners[jQuery(this).attr("id")],t=jQuery(this).val();t>e.max?t=e.max:t<e.min&&(t=e.min);jQuery("#"+e.id+"-spinner").spinner("value",t);jQuery("#"+e.id).val(t)});jQuery(".spinner-input").typeWatch({callback:function(e){if(!jQuery(this).hasClass("spinnerInputChange"))return;jQuery(this).removeClass("spinnerInputChange");var t=reduxSpinners[jQuery(this).attr("id")];e>t.max?e=t.max:e<t.min&&(e=t.min);jQuery("#"+t.id+"-spinner").spinner("value",e);jQuery("#"+t.id).val(e)},wait:400,highlight:!1,captureLength:1})});